import React from 'react';

function SendNotifications() {
  const handleSendNotification = () => {
    console.log('Notification Sent!');
    // Implement your API call to send notifications
  };

  return (
    <div
      style={{
        position: 'absolute',
        bottom: '210px', // Adjusted to position it above the wishlist component
        left: '10px',
        width: '200px',
        backgroundColor: '#fff',
        borderRadius: '10px',
        padding: '20px',
        boxShadow: '0 4px 8px rgba(0, 0, 0, 0.2)',
        display: 'flex',
        flexDirection: 'column',
        alignItems: 'center',
      }}
    >
      <button
        onClick={handleSendNotification}
        style={{
          padding: '10px 20px',
          backgroundColor: '#4CAF50',
          color: 'white',
          border: 'none',
          borderRadius: '5px',
          fontSize: '16px',
          cursor: 'pointer',
        }}
      >
        Send Notification
      </button>
    </div>
  );
}

export default SendNotifications;
